import React from 'react'
import './EVFranchise.css'

const EvFranchise = () => {
  return (
    <div>
      <h1 style={{ fontSize: "50px", fontWeight: "700", color: "#4dbf1c", textAlign: "center", paddingBottom: '50px', paddingTop: '35px' }}>EV Jobs</h1>

    <img className='franchisePamphlet' src="Images\franchisePamphlet.png" alt="franchisePamphlet"  />
    </div>
  )
}

export default EvFranchise
